using System;
using System.Collections.Generic;
using System.Text;

[assembly: System.Runtime.CompilerServices.InternalsVisibleTo("LiveUnitTesting.GrpcClient.Tests, ")]

namespace LiveUnitTesting.GrpcClient
{
    using System;
    using System.Collections.Generic;
    using System.Linq;
    using System.Net.Http;
    using System.Text.Json;
    using System.Threading;
    using System.Threading.Tasks;
    using Grpc.Core;
    using Google.Protobuf;
    using Autogenerated = Autogen.Grpc.v1;
    using System.Net.Http.Json;
    using Google.Protobuf.WellKnownTypes;
    using Grpc.Net.Client;

    /// <summary>
    /// A client for interacting with the Dapr endpoints.
    /// </summary>
    public class DaprClientGrpc : DaprClient
    {
        private readonly Autogenerated.Dapr.DaprClient client;

        internal Autogenerated.Dapr.DaprClient Client => client;

        /// <summary>
        /// 
        /// </summary>
        public DaprClientGrpc()
        {
            var grpcEndpoint = new Uri("bla://");

            var channel = GrpcChannel.ForAddress(grpcEndpoint);

            this.client = new Autogenerated.Dapr.DaprClient(channel);
        }
    }
}
